// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;
import "./DTO/IdentityDTO.sol";
import "./YoukiIdentity.sol";
import "./libraries/CheckingLib.sol";


contract IdentityHandlerLogic  {

        function createNewIdentity(IdentityDTO memory dto) external returns(YoukiIdentity){                        
            return new YoukiIdentity(dto);
        }

}
